ASCII (англ. American standard code for information interchange, [ˈæs.ki]) — название таблицы (кодировки, набора), в которой некоторым распространённым печатным и непечатным символам сопоставлены числовые коды. Таблица была разработана и стандартизирована в США, в 1963 году. Таблица ASCII определяет коды для символов: 
* Десятичных цифр; 
* латинского алфавита; 
* национального алфавита; 
* знаков препинания; 
* управляющих символов.

